// App.js
import React from 'react';
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';
import Home from './components/HomePage/Home';
import Property from './components/InsuranceForms/Property';
import 'bootstrap/dist/css/bootstrap.min.css';
import SignInPage from './components/InsuranceForms/SignInPage';
import TotalInfo from './components/ListOfPolicies/TotalInfo';
import { UserProvider } from './components/ListOfPolicies/UserContext';
import Paymentpage from './payment/Paymentpage';
import { PropertyProvider } from './components/InsuranceForms/PropertyContext'; // Import the PropertyProvider

function App() {
  return (
    <Router>
      <UserProvider>
        <PropertyProvider>
          <Routes>
            <Route path="/" element={<Home />} />
            <Route path="/property" element={<Property />} />
            <Route path="/signin" element={<SignInPage />} />
            <Route path="/success" element={<TotalInfo />} />
            <Route path="/Payment" element={<Paymentpage />} />
          </Routes>
        </PropertyProvider>
      </UserProvider>
    </Router>
  );
}

export default App;
